  true,\n\t\"url\": null,\n\t\"notes\": \"The Title V Permitting Statistics Inventory
  contains measured and estimated nationwide statistical data, consisting of counts
  of permitted sources, types of permits issued, and the timeliness of permit issuance,
  for the operating permits programs being implemented under CAA authority (40 CFR
  parts 70 and 71). This data is non-source specific. The statutory authority leading
  to the collection of this information comes from Title V of the Clean Air Act.Prior
  to July 2008, data collected on state permit programs (part 70) was not equivalent
  to that collected when EPA was the permitting agency (part 71).  Current system
  includes semiannual data from 2006-present; prior data is archived.Data is currently
  not publicly available, certain statistical data has been made available in the
  past, but not currently. This data is mostly used for ICR and PART reporting purposes.\",\n\t\"license_title\":
